script: |
  super -f text -I q3757.spq | sort > q3757.out

inputs:
  - name: q3757.spq
    data: |
      SELECT DISTINCT + 65 + - CAST ( col1 AS INTEGER ) AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - col0 + col2 NOT IN ( + - col0 * - col2, 95, + col1 * - col1 + - col1, col2, col1 );
  - name: tab0

outputs:
  - name: q3757.out
    data: |
